import React from 'react';

const Map = () => {

    let map;
    function initMap() {
        map = new google.maps.Map(document.getElementById("map"), {
          center: { lat: 48.852024, lng: 2.28666 },
          zoom: 8,
        });
      }

    return(
        <div className="map">
            <h1>Google Map</h1>
            map
            </div>
    )
}

export default Map;







